import { FC, useEffect, useRef, useState } from 'react';
import { MainView } from '../types';
const xpfLogo = 'data:image/png;base64,';

interface TopNavProps {
  currentView: MainView;
  onChangeView: (view: MainView) => void;
  navItems: { label: string; value: MainView }[];
  userMenuItems: { label: string; value: MainView }[];
  isDarkMode: boolean;
  onToggleDarkMode: () => void;
  onLogout?: () => void;
  username?: string;
  showFeatureToggles?: boolean;
  onToggleFeaturePanel?: () => void;
}

export const TopNav: FC<TopNavProps> = ({
  currentView,
  onChangeView,
  navItems,
  userMenuItems,
  isDarkMode,
  onToggleDarkMode,
  onLogout,
  username,
  showFeatureToggles = false,
  onToggleFeaturePanel,
}) => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const [userMenuOpen, setUserMenuOpen] = useState(false);
  const desktopUserMenuRef = useRef<HTMLDivElement | null>(null);
  const mobileUserMenuRef = useRef<HTMLDivElement | null>(null);

  useEffect(() => {
    const handleOutsideClick = (event: MouseEvent) => {
      if (event.target instanceof Node) {
        const clickedDesktop = desktopUserMenuRef.current?.contains(event.target);
        const clickedMobile = mobileUserMenuRef.current?.contains(event.target);
        if (clickedDesktop || clickedMobile) {
          return;
        }
        setUserMenuOpen(false);
      }
    };

    if (userMenuOpen) {
      document.addEventListener('mousedown', handleOutsideClick);
    }

    return () => {
      document.removeEventListener('mousedown', handleOutsideClick);
    };
  }, [userMenuOpen]);

  const handleSelect = (view: MainView) => {
    onChangeView(view);
    setMobileOpen(false);
    setUserMenuOpen(false);
  };

  return (
    <header className="w-full rounded-[32px] border border-white/80 bg-white/80 p-4 shadow-[0_24px_60px_rgba(30,64,175,0.15)] backdrop-blur-2xl dark:border-slate-800/60 dark:bg-slate-900/70 dark:shadow-black/40">
      <div className="flex flex-wrap items-center justify-between gap-4">
        <div className="flex items-center gap-3">
          <img
            src={xpfLogo}
            alt="XPF logo"
            className="h-12 w-auto"
            loading="lazy"
          />
        </div>
        <nav className="hidden items-center gap-1 rounded-full border border-white/80 bg-white/90 p-1 shadow-[inset_0_1px_0_rgba(255,255,255,0.9)] dark:border-slate-800/60 dark:bg-slate-900/60 md:flex">
          {navItems.map((item) => (
            <button
              key={item.value}
              onClick={() => handleSelect(item.value)}
              className={`rounded-full px-5 py-2 text-sm font-medium transition ${
                currentView === item.value
                  ? 'bg-white text-slate-900 shadow-[0_6px_18px_rgba(15,23,42,0.12)] dark:bg-slate-800 dark:text-white'
                  : 'text-slate-500 hover:text-slate-800 dark:text-slate-400 dark:hover:text-slate-100'
              }`}
            >
              {item.label}
            </button>
          ))}
        </nav>
        <div className="hidden items-center gap-3 md:flex">
          {onLogout ? (
            <button
              onClick={onLogout}
              className="inline-flex items-center justify-center rounded-full border border-white/70 bg-white/70 px-4 py-2 text-sm font-semibold text-slate-700 shadow-sm dark:border-slate-700/70 dark:bg-slate-800/70 dark:text-slate-100"
            >
              Log out
            </button>
          ) : null}
          <div className="flex items-center gap-2 rounded-full border border-white/80 bg-white/80 px-2 py-1 shadow-sm dark:border-slate-700/70 dark:bg-slate-800/70">
            <button
              className="inline-flex h-9 w-9 items-center justify-center rounded-full border border-white/70 bg-white/90 text-base text-slate-700 shadow-sm dark:border-slate-700/70 dark:bg-slate-900/70 dark:text-slate-200"
              aria-label="Notifications"
            >
              
            </button>
            <button
              onClick={onToggleDarkMode}
              aria-pressed={isDarkMode}
              className="inline-flex h-9 w-9 items-center justify-center rounded-full border border-white/70 text-lg text-slate-700 shadow-sm dark:border-slate-700/70 dark:text-slate-200"
              aria-label={isDarkMode ? 'Switch to light mode' : 'Switch to dark mode'}
            >
              {isDarkMode ? '' : ''}
            </button>
          </div>
          <div className="text-right">
            <p className="text-sm font-semibold text-slate-900 dark:text-white">{username ?? 'Kevin Brooks'}</p>
            <p className="text-xs text-slate-500 dark:text-slate-400">kevin@firm.co.uk</p>
          </div>
          <div className="relative" ref={desktopUserMenuRef}>
            <button
              onClick={() => setUserMenuOpen((prev) => !prev)}
              className="flex h-12 w-12 items-center justify-center rounded-full border border-white/70 bg-gradient-to-br from-slate-900 via-indigo-900 to-slate-800 text-sm font-semibold text-white shadow-lg shadow-indigo-900/30"
              aria-haspopup="menu"
              aria-expanded={userMenuOpen}
              aria-label="Open user menu"
            >
              {username ? username.slice(0, 2).toUpperCase() : 'KB'}
            </button>
            {userMenuOpen ? (
              <div
                role="menu"
                className="absolute right-0 top-12 z-20 w-48 rounded-2xl border border-white/70 bg-white/95 p-2 text-sm shadow-xl dark:border-slate-800/80 dark:bg-slate-900/95"
              >
                {userMenuItems.map((item) => (
                  <button
                    key={item.value}
                    onClick={() => handleSelect(item.value)}
                    className={`flex w-full items-center justify-between rounded-xl px-3 py-2 text-left font-medium transition ${
                      currentView === item.value
                        ? 'bg-slate-100 text-slate-900 dark:bg-slate-800 dark:text-white'
                        : 'text-slate-600 hover:text-slate-900 dark:text-slate-300 dark:hover:text-white'
                    }`}
                    role="menuitem"
                  >
                    {item.label}
                  </button>
                ))}
              </div>
            ) : null}
          </div>
        </div>
        <div className="flex flex-1 items-center justify-end gap-3 md:hidden">
          <button
            onClick={onToggleDarkMode}
            aria-pressed={isDarkMode}
            className="inline-flex h-10 w-10 items-center justify-center rounded-full border border-white/70 text-slate-700 shadow-sm dark:border-slate-700/70 dark:text-slate-200"
            aria-label={isDarkMode ? 'Switch to light mode' : 'Switch to dark mode'}
          >
            {isDarkMode ? '' : ''}
          </button>
          <button
            onClick={() => setMobileOpen((prev) => !prev)}
            className="inline-flex h-10 w-10 items-center justify-center rounded-full border border-white/70 text-slate-700 shadow-sm dark:border-slate-700/70 dark:text-slate-200"
            aria-label="Toggle navigation"
          >
            
          </button>
          <div className="relative" ref={mobileUserMenuRef}>
            <button
              onClick={() => setUserMenuOpen((prev) => !prev)}
              className="flex h-10 w-10 items-center justify-center rounded-2xl bg-slate-900 text-xs font-semibold text-white"
              aria-haspopup="menu"
              aria-expanded={userMenuOpen}
              aria-label="Open user menu"
            >
              {username ? username.slice(0, 2).toUpperCase() : 'KB'}
            </button>
            {userMenuOpen ? (
              <div
                role="menu"
                className="absolute right-0 top-12 z-20 w-44 rounded-2xl border border-white/70 bg-white/95 p-2 text-sm shadow-xl dark:border-slate-800/80 dark:bg-slate-900/95"
              >
                {userMenuItems.map((item) => (
                  <button
                    key={item.value}
                    onClick={() => handleSelect(item.value)}
                    className={`flex w-full items-center justify-between rounded-xl px-3 py-2 text-left font-medium transition ${
                      currentView === item.value
                        ? 'bg-slate-100 text-slate-900 dark:bg-slate-800 dark:text-white'
                        : 'text-slate-600 hover:text-slate-900 dark:text-slate-300 dark:hover:text-white'
                    }`}
                    role="menuitem"
                  >
                    {item.label}
                  </button>
                ))}
              </div>
            ) : null}
          </div>
        </div>
      </div>
      {mobileOpen && (
        <div className="mt-4 rounded-3xl border border-white/70 bg-white/90 p-4 shadow-inner dark:border-slate-800/80 dark:bg-slate-900/80 md:hidden">
          <div className="space-y-2">
            {navItems.map((item) => (
              <button
                key={item.value}
                onClick={() => handleSelect(item.value)}
                className={`flex w-full items-center justify-between rounded-2xl px-4 py-3 text-left text-sm font-medium ${
                  currentView === item.value
                    ? 'bg-slate-100 text-slate-900 dark:bg-slate-800 dark:text-white'
                    : 'text-slate-600 dark:text-slate-300'
                }`}
              >
                {item.label}
              </button>
            ))}
            {onLogout ? (
              <button
                onClick={onLogout}
                className="flex w-full items-center justify-between rounded-2xl border border-white/70 bg-white/80 px-4 py-3 text-left text-sm font-semibold text-slate-700 dark:border-slate-700/70 dark:bg-slate-800/70 dark:text-slate-100"
              >
                Log out
              </button>
            ) : null}
            {showFeatureToggles && onToggleFeaturePanel ? (
              <button
                onClick={onToggleFeaturePanel}
                className="flex w-full items-center justify-between rounded-2xl border border-white/70 bg-white/70 px-4 py-3 text-left text-sm font-semibold text-slate-700 dark:border-slate-700/70 dark:bg-slate-800/70 dark:text-slate-100"
              >
                Feature toggles
              </button>
            ) : null}
            <div className="rounded-2xl border border-white/60 bg-slate-50/80 p-3 text-sm text-slate-600">
              <p className="font-semibold text-slate-900">{username ?? 'Kevin Brooks'}</p>
              <p>kevin@firm.co.uk</p>
            </div>
          </div>
        </div>
      )}
    </header>
  );
};
